import { inject, Injector } from "@angular/core";
import { QueryClient } from "@tanstack/query-core";
function injectQueryClient(injectOptions = {}) {
  return (injectOptions.injector ?? inject(Injector)).get(QueryClient);
}
export {
  injectQueryClient
};
